import React from 'react';
import './NavBar.css';



export default class NavBar extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      array: [],
    };

  }




  render() {



  }
}

function randomIntFromInterval(min, max) {
  // min and max included
  return Math.floor(Math.random() * (max - min + 1) + min);
}
